import { useEffect, useState } from 'react';

const Navigation = () => {
  const [data, setData] = useState(null);
  /* henter nav-data fra sanity */
  useEffect(() => {
    const fetchDataAsync = async () => {
      setLoading(true);
      try {
        const navigation = await getNav('Header');
        setData(navigation);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };
    fetchDataAsync();
  }, []);
};
export default Navigation;
